import { Component } from "react";

class Main extends Component{
    render(){
        return(
            <div className="container">
                <div className="row">

                    <div className="col-md-10 Header">
                        <h1>Where in the world?</h1>
                    </div>
                    <div className="col-md-2">
                        Dark Mode
                    </div>
                </div>
               
            </div>
        )
    }
}
export default Main
